import React from 'react';
import { useNavigate } from 'react-router-dom';
import logo from './assets/Logo.jpeg'; // Make sure path is correct
import './index.css';

const Login = () => {
  const navigate = useNavigate();

  return (
    <div className="main-container">
      <div className="logo-container">
        <img src={logo} alt="Trellis Logo" />
      </div>
      <h2 style={{color: 'white', marginBottom: '30px'}}>LOGIN</h2>
      <form>
        <div className="input-group">
          <input type="email" placeholder="Email Address" required />
        </div>
        <div className="input-group">
          <input type="password" placeholder="Password" required />
        </div>
        <button type="submit" className="glass-btn">LOGIN</button>
      </form>
      <p style={{color: '#888', marginTop: '20px', fontSize: '14px'}}>
        New to Trellis? <span onClick={() => navigate('/register')} style={{color: '#8b5cf6', cursor: 'pointer', fontWeight: '600'}}>Sign Up</span>
      </p>
    </div>
  );
};

export default Login;
